import React from "react";
import Expenses from "./components/Expenses/Expenses";
import NewExpense from "./components/NewExpense/NewExpense";


function App() {

  const expenses = [
    {
      id: 'e1',
      title: 'Cyberboard R3',
      maker: 'Angry Miao',
      amount: 424.99,
      date: new Date(2022, 11, 10),
    },
    { 
      id: 'e2', 
      title: 'Bella 75', 
      maker: 'KBDFans', 
      amount: 279.99, 
      date: new Date(2022, 10, 20) },
    {
      id: 'e3',
      title: 'Montex 27',
      maker: 'Idobao',
      amount: 89.99,
      date: new Date(2022, 10, 2),
    },
    {
      id: 'e4',
      title: 'Tofu 65',
      maker: 'KBDFans',
      amount: 199.99,
      date: new Date(2022, 9, 12),
    },
  ];
  return (
    <div>
      <h2>Keebs World</h2>
      <NewExpense />
      <Expenses items={expenses} />
    </div>
  );
}

export default App;
